import React from 'react';
import { Link } from 'react-scroll';
import './NavigationBar.css';
import DarkModeToggle from './DarkModeToggle/DarkModeToggle';

function NavigationBar() {
    return (
        <nav className="navbar">
            <ul className="navbar__list">
                <li>
                    <Link 
                        activeClass="navbar__link-active" 
                        to="home" 
                        spy={true} 
                        smooth={true} 
                        offset={-70} 
                        duration={500}
                    >
                        Home
                    </Link>
                </li>
                <li>
                    <Link 
                        activeClass="navbar__link-active" 
                        to="about" 
                        spy={true} 
                        smooth={true} 
                        offset={-70} 
                        duration={500}
                    >
                        About
                    </Link>
                </li>
                <li>
                    <Link 
                        activeClass="navbar__link-active" 
                        to="projects" 
                        spy={true} 
                        smooth={true} 
                        offset={-70} 
                        duration={500}
                    >
                        Projects
                    </Link>
                </li>
                <li>
                    <Link 
                        activeClass="navbar__link-active" 
                        to="contact" 
                        spy={true} 
                        smooth={true} 
                        offset={-70} 
                        duration={500}
                    >
                        Contact
                    </Link>
                </li>
            </ul>

            <div className="navbar__toggle">
                <DarkModeToggle />
            </div>
        </nav>
    );
}

export default NavigationBar;
